import React from "react";
import { Link } from "react-router-dom";
import { useDispatch } from "react-redux"; // Import useDispatch hook
import { logout } from "../actions/userActions"; // Import logout action creator
import pic from "../images/dazzling.jpg";
import pic2 from "../images/wp3.jpg";
import "../styles.css";

function Dashboard() {
  const dispatch = useDispatch(); // Initialize useDispatch hook

  const handleLogout = () => {
    dispatch(logout()); // Dispatch the logout action
  };

  return (
    <div
      style={{
        position: "relative",
        overflow: "hidden",
      }}
    >
      <div style={{ margin: "24px", overflowY: "auto", height: "100vh" }}>
        {/* Rest of the component JSX */}
        <Link to="/login">
          <button
            style={{
              cursor: "pointer",
              border: "2px solid rgba(18, 0, 184, 1)",
              backgroundColor: "rgba(18, 0, 184, 1)",
              borderRadius: "5px",
              color: "#ffffff",
              padding: "10px",
              fontSize: "18px",
            }}
          >
            Login
          </button>
        </Link>

        {/* Add Logout Button */}
        <button
          onClick={handleLogout} // Call handleLogout function on button click
          style={{
            cursor: "pointer",
            border: "2px solid rgba(18, 0, 184, 1)",
            backgroundColor: "rgba(18, 0, 184, 1)",
            borderRadius: "5px",
            color: "#ffffff",
            padding: "10px",
            fontSize: "18px",
            marginTop: "20px", // Adjust spacing as needed
          }}
        >
          Logout
        </button>

        <div style={{ position: "relative" }}>
          <h1
            style={{
              color: "#004cff",
              fontSize: "50px",
              margin: 0,
              padding: 0,
            }}
          >
            인뱅
          </h1>
          <h2
            style={{
              color: "#004cff",
              position: "absolute",
              fontSize: "20px",
              top: "40px",
              left: "50px",
              transform: "rotate(-24deg)",
            }}
          >
            In-Bang
          </h2>
        </div>
        <br />
        <br />
        <br />
        <br />
      </div>
    </div>
  );
}

export default Dashboard;
